import React from "react";
const Navbar = () => {
  return (
    <>
      <div className="container Navbar">
        <div className="row">
          <div className="col-6 logoo">
            <h1>UsmanKhalid</h1>
          </div>
          <div className="col-6"></div>
        </div>
      </div>
    </>
  );
};

const Comman = () => {
  return (
    <>
      <Navbar />
    </>
  );
};
export default Comman;
